  false,\n\t\"url\": null,\n\t\"notes\": \"During 2012, the U.S. Geological Survey
  and other agencies made approximately 2,500 water-level measurements in the Mojave
  River and Morongo groundwater basins. These data document recent conditions and,
  when compared with previous data, changes in groundwater levels. A water-level contour
  map was drawn using data from about 575 wells, providing coverage for most of the
  basins. Twenty-eight hydrographs show long-term (1930-2012) water-level conditions
  throughout the basins, and 9 short-term (1992 to 2012) hydrographs show the effects
  of recharge and discharge along the Mojave River. In addition, a water-level-change
  map was compiled to compare 2010 and 2012 water levels throughout the basins (516
  wells).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
